 renato:\n\nA arte produziu as imagens usando o efeito de multiply direto no Illustrator. Só que quando fui extrair as imagens para  Photoshop, elas não trouxeram o efeito e ficaram BEM diferentes. Não sei se seria o caso deles ajustarem as imagens que ficaram estranhas.\n\nA sugestão de animação que a arte propôs para a seleção de tema fica muito bonita nos 4 elementos de cima, mas não ficou boa nos 3 de baixo. Acho que precisaríamos pensar em uma melhor.\n\nQuando acertamos a personalidade escolhida pelo sistema, em nenhum momento vemos o nome dela sem entrar no índice. Seria legal incluir um passo para aparecer o nome.\n\nNo relatório foi indicado para aparecer os créditos das personalidades somente durante o jogo, mas no índice não aparece. Deixei a programação pronta para incluir o crédito de cada um, mas não tive tempo para separa os créditos dos blocos. Caso seja necessário, peço ajuda para separa-los.\n','2015-02-23 08:59:22'),(618,1164,9290,18,'itens 22, 28, 19 e 13 do relatório de consolidação estão sendo desconsiderados. não há base para pedir o que está sendo solicitado, uma vez que, no caso dos botões, o fechar já tem a função solicitada. no caso das animas, não é possível fazer as animações sem que a arte gere todos os frames dos animais se mexendo.','2015-02-23 16:59:06'),(620,1119,9338,18,'foi reaberto em 24/02 para correção de crédito.','2015-02-24 16:46:59'),(622,1290,9343,4,'a editora havia recebido a prova e, antes de entregar a revisão, irá adaptar pra usarmos em HTML\n','2015-02-24 19:05:34'),(629,1207,8558,4,'Pendente de DA','2015-02-26 10:49:38'),(630,1204,8555,4,'Pendente de DA','2015-02-26 10:49:50'),(631,1201,8552,4,'Pendente de DA','2015-02-26 10:50:00'),(632,1205,8556,4,'Pendente de DA','2015-02-26 10:50:11'),(633,1224,8664,4,'Pendente de DA','2015-02-26 10:50:22'),(634,1180,8531,4,'Cronograma estendido','2015-02-26 10:51:09'),(635,1193,8544,4,'Cronograma estendido','2015-02-26 10:51:19'),(636,1192,8543,4,'Cronograma estendido','2015-02-