),(683,1488,9794,4,'reaproveitamento integral\n','2015-03-05 19:25:21'),(684,1489,9796,4,'reaproveitamento integral','2015-03-05 19:25:32'),(685,1490,9798,4,'reaproveitamento integral','2015-03-05 19:25:44'),(686,1048,9802,18,'relatório do editor enviado para a produtora. uma úncia correção. pedi os arquivos abertos.','2015-03-05 19:39:36'),(688,1072,9594,18,' \nConforme conversamos pelo fone. É preciso corrigir alguns itens no objeto, por isso, estou devolvendo a prova:\n \n•         Créditos de imagem: eles devem entrar e sair em fade, mesmo que a troca seja rápida. Estão entrando e saindo de forma brusca. Corrigir\n•         Arrasto (“fantasminha rosa”): Ele deve acompanhar o atleta desde o início, quando ele surge do lado esquerdo da cena. As barras estão entrando com ele, de forma correta, mas o arrasto (fantasminha) não. Corrigir. Importante, há um bug logo na primeira vez que acionamos a tela. O atleta está entrando direto no meio da tela, sem iniciar a passagem. Quando saímos e voltamos rpa tela, ele faz da forma certa. Corrigir isso também.\n•         Cronômetro balançando: a solicitação foi de uma piscada, e não de movimentação. Mantenha só a piscada e, após o clique, ele deverá ficar completamente estático.\n•         Barras de energia x cronômetro: na versão anterior, havia um “delay” entre a parada do cronômetro e a parada da barra. Nesta versão, o cronômetro para e a barra “pula” para a posição final. É preciso que ela pare estática junto com o final do cronômetro. Sem pulos e sem delays. \n \n','2015-03-05 21:08:25'),(689,1493,9626,4,'Reaproveitamento integral','2015-03-06 10:15:13'),(690,1494,9627,4,'Reaproveitamento integral','2015-03-06 10:15:27'),(691,1495,9628,4,'Reaproveitamento integral','2015-03-06 10:15:40'),(692,1496,9629,4,'Reaproveitamento integral','2015-03-06 10:15:54'),(693,1497,9630,4,'Reaproveitamento integral','2015-03-06 10:16:06'),(694,1498,9631,4,'Reaproveitamento integral','2015-03-06 10:16:17'),(695,1499,9632,4,'Reaproveitamento