/*Table structure for table `moderna_collections` */

DROP TABLE IF EXISTS `moderna_collections`;

CREATE TABLE `moderna_collections` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `project_id` int(11) DEFAULT NULL,
  `materia_id` int(11) NOT NULL,
  `segmento_id` int(11) DEFAULT NULL,
  `op` varchar(250) NOT NULL,
  `ano` int(4) NOT NULL,
  `fechamento` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `materia_fk` (`materia_id`),
  KEY `segmento_fk` (`segmento_id`),
  CONSTRAINT `materia_fk` FOREIGN KEY (`materia_id`) REFERENCES `moderna_materias` (`id`),
  CONSTRAINT `segmento_fk` FOREIGN KEY (`segmento_id`) REFERENCES `moderna_segmentos` (`id`)
