  `duracao` varchar(100) DEFAULT NULL,
  `sinopse` text,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `uploaded` enum('0','1') DEFAULT '0',
  `crono_date` datetime DEFAULT NULL,
  `planned_date` datetime DEFAULT NULL,
  `delivered_date` datetime DEFAULT NULL,
  `diff` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `type_object_idx` (`typeobject_id`),
  KEY `project_idx` (`project_id`),
  KEY `collection_idx` (`collection_id`),
  KEY `format_idx` (`format_id`),
  KEY `object_idx` (`object_id`),
  KEY `fase_idx` (`fase`),
  CONSTRAINT `tipo_obj_fk` FOREIGN KEY (`typeobject_id`) REFERENCES `moderna_typeobjects` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=5026 DEFAULT CHARSET=utf8;

