/*!50001 CREATE ALGORITHM=TEMPTABLE DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `moderna_objectstatus` AS select `obj`.`id` AS `id`,`obj`.`title` AS `title`,`obj`.`taxonomia` AS `taxonomia`,`obj`.`typeobject_id` AS `typeobject_id`,`type`.`name` AS `typeobject_name`,`format`.`name` AS `format`,`obj`.`tamanho` AS `tamanho`,`obj`.`duracao` AS `duracao`,`obj`.`collection_id` AS `collection_id`,`obj`.`fase` AS `fase`,`obj`.`interatividade` AS `interatividade`,`obj`.`reaproveitamento` AS `reaproveitamento`,`collections`.`name` AS `collection_name`,`collections`.`fechamento` AS `collection_fechamento`,`collections`.`materia_id` AS `materia_id`,`materias`.`name` AS `materia_name`,`obj_status`.`id` AS `object_status_id`,`obj_status`.`status_id` AS `status_id`,`obj_status`.`created_at` AS `envio`,`obj_status`.`crono_date` AS `retorno`,`obj_status`.`diff` AS `diff`,`status`.`status` AS `statu_status`,`status`.`type` AS `statu_type`,`obj`.`crono_date` AS `crono_date`,`obj`.`project_id` AS `project_id`,`projects`.`name` AS `project_name`,`projects`.`pasta` AS `project_pasta`,`projects`.`segmento_id` AS `segmento_id`,`projects`.`status` AS `project_status` from ((((((((`moderna_objects` `obj` join `moderna_objects_status` `obj_status` on((`obj_status`.`object_id` = `obj`.`id`))) left join `moderna_objects_status` `obj_status2` on(((`obj_status2`.`object_id` = `obj`.`id`) and (`obj_status`.`id` < `obj_status2`.`id`)))) join `moderna_typeobjects` `type` on((`type`.`id` = `obj`.`typeobject_id`))) join `moderna_collections` `collections` on((`collections`.`id` = `obj`.`collection_id`))) join `moderna_materias` `materias` on((`materias`.`id` = `collections`.`materia_id`))) join `moderna_formats` `format` on((`format`.`id` = `obj`.`format_id`))) join `moderna_status` `status` on((`status`.`id` = `obj_status`.`status_id`))) join `moderna_projects` `projects` on((`projects`.`id` = `obj`.`project_id`))) where (isnull(`obj_status2`.`id`) and (`projects`.`id` = `collections`.`project_id`)) group by `obj`.`id` */;

